import React, { useEffect, useState } from "react";
//import axios from "axios";

export default function GetActos(idRegistro = "-1") {
  const [Actos, setData] = useState(null);

  useEffect(() => {
    fetchData();
  }, []);

  const fetchData = async () => {
    try {
      const response = await fetch("http://localhost:8000/actos?idRegistro=" +idRegistro);
      const jsonData = await response.json();
      setData(jsonData);
    } catch (error) {
      console.log("Error fetching data:", error);
    }
  };
  if (Actos) {
    return Actos.map(({ id_acto, acto_descripcion }) => (
      <option key={id_acto} value={id_acto}>
        {acto_descripcion}
      </option>
    ));
  }
}
